import React from 'react'
import './styles/Aboutus.css'
// import Slider from '../components/Slider'
function Aboutus() {
    return (
        <section id='Aboutus'>
            <div className='bgAbout'>
                <div className='d-flex justify-content-center align-items-center'>
                    <h1>Aboutus</h1>
                </div>
            </div>
        </section>
    )
}

export default Aboutus
